import * as React from 'react';
import {TextField } from '@mui/material';
import Dialog from '@mui/material/Dialog';
import DialogContent from '@mui/material/DialogContent'
import DialogTitle from '@mui/material/DialogTitle';
import Button from 'react-bootstrap/Button';
import './NewOrder.css'


export default function NewOrder({ open, handleClose }) {

    return (
        <Dialog
            open={open}
            onClose={handleClose}
            aria-labelledby="alert-dialog-title"
            aria-describedby="alert-dialog-description"
        >
            <DialogTitle id="alert-dialog-title">Place order</DialogTitle>
            <DialogContent>
                <form>
                    <TextField id="mobileNo" placeholder="Enter Mobile No" lable="mobile_No" variant='outlined' margin='dense' fullWidth />
                    <TextField id="productName" placeholder="Enter Product Name" lable="product_Name" variant='outlined' margin='dense' fullWidth />
                    <TextField id="couponCode" placeholder="Enter Coupon Code" lable="coupon_Code" variant='outlined' margin='dense' fullWidth />
                </form>
            </DialogContent>
                <div style={{marginLeft:"20px",marginRight:"20px"}}>
                <Button variant="primary">Submit</Button>
                <Button variant="danger" onClick={handleClose}>cancal</Button>
                </div>
        </Dialog>

    );
}
